import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styles from "./Navbar.module.css";
import "bootstrap/dist/css/bootstrap.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars, faTimes } from "@fortawesome/free-solid-svg-icons";
import ModalBoxContainer from "../ProjectSection/ModalBox";

const Navbar = () => {
  const [scrollPosition, setScrollPosition] = useState(0);
  const [click, setClick] = useState(false);
  const [showModal, setShowModal] = useState(false);
  const [linkClicked, setLinkClicked] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const position = window.scrollY;
      setScrollPosition(position);
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const navbarStyle = {
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: scrollPosition > 0 ? "black" : "transparent",
  };

  const scrollToSection = (id) => {
    setLinkClicked(true);
    setShowModal(false);
    const element = document.getElementById(id);
    if (element) {
      const yOffset = -50;
      const y = element.offsetTop + yOffset;
      window.scrollTo({ top: y, behavior: "smooth" });
    }
  };

  /* toggleBtn */
  const handleClick = () => {
    setClick(!click);
  };

  return (
    <header id="header" className="fixed-top" style={navbarStyle}>
      <nav id="navbar" className={styles.navbar}>
        <Link
          className={styles.logo}
          to="/hero"
          onClick={() => {
            setLinkClicked(true);
            setShowModal(false);
            scrollToSection("about");
          }}
        >
          Portfolio
        </Link>
        {/*<ul className={styles.navbar_ul}>*/}
        <ul className={`${styles.navbar_ul} ${click ? styles.active : ""}`}>
          <li className={styles.navbar_li}>
            <Link
              to="/hero"
              activeClassName="active"
              className="nav-link"
              onClick={() => {
                setLinkClicked(true);
                setShowModal(false);
                scrollToSection("hero");
              }}
            >
              Home
            </Link>
          </li>
          <li className={styles.navbar_li}>
            <Link
              to="/about"
              activeClassName="active"
              className="nav-link"
              onClick={() => scrollToSection("about")}
            >
              About
            </Link>
          </li>
          <li className={styles.navbar_li}>
            <Link
              to="/skill"
              activeClassName="active"
              className="nav-link"
              onClick={() => scrollToSection("skill")}
            >
              Skills
            </Link>
          </li>
          <li className={styles.navbar_li}>
            <Link
              to="/edu"
              activeClassName="active"
              className="nav-link"
              onClick={() => scrollToSection("edu")}
            >
              Education
            </Link>
          </li>
          <li className={styles.navbar_li}>
            <Link
              to="/project"
              activeClassName="active"
              className="nav-link"
              onClick={() => scrollToSection("project")}
            >
              Project
            </Link>
          </li>
          <li className={styles.navbar_li}>
            <Link
              to="/contact"
              activeClassName="active"
              className="nav-link"
              onClick={() => scrollToSection("contact")}
            >
              Contact
            </Link>
          </li>
        </ul>
        <div
          className={`${styles.toggleBtn} ${click ? styles.active : ""}`}
          onClick={handleClick}
        >
          <FontAwesomeIcon icon={click ? faTimes : faBars} />
        </div>
      </nav>
      {showModal && (
        <ModalBoxContainer
          setShowModal={setShowModal}
          selectedModal={selectedModal}
          linkClicked={linkClicked} // Pass the linkClicked state variable
        />
      )}
    </header>
  );
};

export default Navbar;
